import React, {useEffect} from 'react'
import axios from 'axios'
import * as Yup from 'yup'
import { useNavigate } from 'react-router-dom'
import toast from 'react-hot-toast'
import { Formik, Form, Field, ErrorMessage } from 'formik'
export default function Login() {
  const navigate = useNavigate()
  useEffect(() => {
    if(localStorage.getItem("IdUsuario")||localStorage.getItem("TokenUsuario")){
      navigate("/")
    }
  }, []); 

  return (
    <div>
      <Formik
      initialValues={{
        email_usuario: '',
        contraseña_usuario: ''
      }}
      validationSchema={Yup.object({
        email_usuario: Yup.string().required("Es obligatorio poner el correo para iniciar sesion").email("Ha de ser un correo"),
        contraseña_usuario: Yup.string().required("Has de poner una contraseña y minimo ha de tener 8 caracteres")
      })
    }
      >

      </Formik>
    </div>
  )
}
